window.addEventListener("DOMContentLoaded",(async()=>{for(let t of document.querySelectorAll("[data-fetcher]"))try{const e=await fetch(t.dataset.fetcher),n=e.headers.get("content-type");if(!n.includes("text/html"))throw new Error(`Expected HTML got ${n}`);t.innerHTML=await e.text()}catch(t){console.log(t)}}));